import React from "react";
import "./subscription_block.css";

const FeatuerList = ({ features }) => {
  return (
    <div className="sub_block-feature_list">
      {features.map((feature, index) => (
        <Feature
          key={index}
          feature_description={feature.feature_descriptiondescription}
        />
      ))}
    </div>
  );
};

const SubBlock = ({ features }) => {
  return (
    <div className="sub_block">
      <div className="sub_block-pricing_info">
        <div className="sub_block-pricing_amount"></div>
        <p></p>
        {FeatuerList(features)}
      </div>
    </div>
  );
};

export default SubBlock;
